INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('65', '2', 'Tắm và chăm sóc lông cho chó mèo', '&lt;p&gt;Bước 1: Da và lông của cún sẽ được kiểm tra kĩ càng nhằm xác định loại dầu tắm thích hợp. &amp;nbsp;&lt;/p&gt;&lt;p&gt;Bước 2: Các chuyên viên sẽ bóp dịch hậu môn một cách cẩn thận và chuyên nghiệp nhằm khử hoàn toàn mùi hôi trên thân thể các em. &amp;nbsp;&lt;/p&gt;&lt;p&gt;Bước 3: Cún sẽ được xả nước sạch rồi thoa dầu tắm, đồng thời thời nhẹ nhàng massage để thư giãn và loại bỏ chất bẩn trên lông với sự hỗ trợ của các dụng cụ chuyên nghiệp. &amp;nbsp;&lt;/p&gt;&lt;p&gt;Bước 4: Xả sạch sữa tắm và sử dụng dầu xả để tạo độ mềm mượt, đồng thời dưỡng ẩm cho da và lông chó. &amp;nbsp;&lt;/p&gt;&lt;p&gt;Bước 5: Xả lại bằng nước sạch cho đến khi sạch dầu xả, rồi sấy khô và chải lông nhằm loại bỏ lông chết còn sót lại. &amp;nbsp;&lt;/p&gt;&lt;p&gt;Bước 6: Lông cún sẽ được thoa một lớp lotion nhằm tạo độ bóng mượt tự nhiên, sạch sẽ. &amp;nbsp;&lt;/p&gt;&lt;p&gt;Bước 7: Xịt nước hoa, tạo hương thơm lưu giữ lâu dài trên cơ thể chó cưng.&lt;/p&gt;', '', 'Tắm và chăm sóc lông cho chó mèo', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('65', '1', 'Bathe and groom cats and dogs', '&lt;p&gt;Step 1: The dog\'s skin and fur will be carefully examined to determine the appropriate type of bath oil.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Step 2: The therapist will squeeze the anal fluid carefully and professionally to completely eliminate the odor from your body.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Step 3: The dog will be rinsed with clean water and then applied the bath oil, while gently massaging to relax and remove the dirt on the fur with the help of professional tools.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Step 4: Rinse the shower gel and use conditioner to make it soft and moisturize the skin and fur of dogs.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Step 5: Rinse with clean water until the conditioner is clean, then dry and brush to remove remaining hair.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Step 6: The dog\'s coat will be applied with a layer of lotion to create a natural, clean luster.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Step 7: Spray perfume, create a scent, lasting retention on the pet dog.&lt;/p&gt;', '', 'Bathe and groom cats and dogs', '', '');
